import React, { useState } from "react";
import "../stylesheets/layouts/Dog.scss";
import { Link } from "react-router-dom";

const Dog = (props) => {
    let genderColor = "";
    if (props.dogs.gender === "Hembra") {
        genderColor = "pink";
    } else {
        genderColor = "blue";
    }

    return ( <
        article className = "article" >
        <
        img className = "article__image"
        src = { props.dogs.url }
        alt = { props.dogs.name }
        /> <
        div className = "underPhoto" >
        <
        div className = "nameGender" >
        <
        p className = "nameGender__name" > { props.dogs.name } < /p> <
        div className = "nameGender__gender" > {
            props.dogs.gender === "Female" ? ( <
                i className = { ` nameGender__gender--female fas fa-venus  ${genderColor}` } >
                < /i>
            ) : ( <
                i className = { ` nameGender__gender--male fas fa-mars ${genderColor}` } >
                < /i>
            )
        } <
        /div> <
        /div> <
        /div> <
        Link className = "link"
        to = { "/dog/" + props.dog.id } >
        <
        li className = "" >
        <
        button className = "article__button" > Ver perfil < /button> <
        /li> <
        /Link> <
        /article>
    );
};

export default Dog;
